import { useContext } from "react";
import { NavLink } from "react-router-dom";
import { ProductContext } from "..";

export const Header = () => {
  const { dispatch, cart, wishlist } = useContext(ProductContext);
  return (
    <>
      <nav style={{ display: "flex" }}>
        <NavLink to="/">
          <img
            src="data:image/png;base64,"
            height="60px"
            style={{ float: "left" }}
            alt="Home"
          />
        </NavLink>

        <input
          placeholder="Search products..."
          onChange={(e) =>
            dispatch({ type: "searchProduct", value: e.target.value })
          }
          style={{
            float: "left",
            height: "40px",
            margin: "15px",
            marginLeft: "50px",
            width: "55%"
          }}
        />
        <div style={{ display: "flex", flexDirection: "column" }}>
          <NavLink to="/cart">
            <img
              src="data:image/png;base64,"
              height="60px"
              alt="Cart"
            />
          </NavLink>
          <p style={{ color: "red" }}>({cart.length})</p>
        </div>
        <div style={{ display: "flex", flexDirection: "column" }}>
          <NavLink to="/wishlist">
            {" "}
            <img
              src="data:image/png;base64,"
              alt="wishlist"
              height="60px"
              style={{ marginLeft: "15px" }}
            />
          </NavLink>
          <p style={{ color: "red" }}>({wishlist.length})</p>
        </div>
        <NavLink to="/login">
          {" "}
          <img
            src="data:image/png;base64,"
            alt="User"
            height="60px"
            style={{ marginLeft: "15px" }}
          />
        </NavLink>
      </nav>
    </>
  );
};
